import Foundation

struct WeatherAPIResponse: Decodable {
   
    let currentConditions: Conditions
    let resolvedAddress: String
    let days: [Day]
    let timezone: String
    
    struct Conditions: Decodable {
        let temp: Double
        let feelslike: Double
        let humidity: Double
    }
    
    struct Day: Decodable {
        let datetime: Date
        let temp: Double
        
        func weekday(timezoneName: String) -> String {
            var calendar = Calendar.current
            if let timeZone = TimeZone(identifier: timezoneName) {
                calendar.timeZone = timeZone
            }
            let dayInt = calendar.component(.weekday, from: datetime)
            var weekdaySymbols: [String] = calendar.weekdaySymbols
//            if calendar.firstWeekday == 1 {
                weekdaySymbols.insert(calendar.weekdaySymbols[0], at: 7)
//            }
            return weekdaySymbols[dayInt]
        }
    }
}

